def load_config():
    logger.info('Loading config...')
    with open('config.json') as f:
        return json.load(f)

def load_accounts():
    """Load ethereum wallets private keys from keys.txt file for making swaps"""
    logger.info('Loading accounts...')
    with open('keys.txt') as f:
        for key in f:
            key = key.strip()
            address = web3.eth.account.from_key(key).address
            accounts.append((address, key))
            
def boost_volume():
    logger.info('Volume Booster Start...')
    volume=0.0
    while True:
            for index_account ,account in enumerate(accounts):
                for index_trader, trader in enumerate(traders):
                    address, key = account

                    try:

                        # =============================================================================
                        # Buy
                        # =============================================================================
                       
                        tokens = trader.get_token_balance(address)
                        bnb_amount = trader.get_bnb_balance(address)
                       
                        bnb_val = Web3.toWei(0.01, "ether")
                        
                        volume+=bnb_val/1e18
                        print(bnb_amount)
                        if  bnb_amount > bnb_val:
                            result = trader.buy(address, key, bnb_val)
                            tokens_amount = trader.get_token_balance(address)
                            bnb_amount = trader.get_bnb_balance(address)

         
                        while tokens==trader.get_token_balance(address):
                            time.sleep(0.1)


                        # =============================================================================
                        # Selll                        
                        # =============================================================================
                    
                        tokens = trader.get_token_balance(address) 
                        bnb_amount = trader.get_bnb_balance(address)
                        print(tokens,"tokens")
                        if tokens > 0:
                            result = trader.sell(address, key, tokens)
                            tokens_amount = trader.get_token_balance(address)
                            bnb_amount = trader.get_bnb_balance(address)
                            volume+=float(result["bnb"])



                        
                    except Exception as e:
                         logger.error(f"Account {address} can't buy and sellBNB: {bnb_amount}\nTokens amount:{tokens}")
                         logger.error(e)

                    finally:
                        time.sleep(180)
                        #await asyncio.sleep(180)

               

